static char __pyx_k_801[] = "Copy of the array, cast to a specified type.\n\n        Parameters\n        ----------\n        t : string or dtype\n            Typecode or data-type to which the array is cast.\n\n        Examples\n        --------\n        >>> x = np.array([1, 2, 2.5])\n        >>> x\n        array([ 1. ,  2. ,  2.5])\n\n        >>> x.astype(int)\n        array([1, 2, 2])\n\n        ";
static char __pyx_k_802[] = "ndarray.byteswap (line 775)";
static char __pyx_k_803[] = "Swap the bytes of the array elements\n\n        Toggle between low-endian and big-endian data representation by\n        returning a byteswapped array, optionally swapped in-place.\n\n        Parameters\n        ----------\n        inplace: bool, optional\n            If ``True``, swap bytes in-place, default is ``False``.\n\n        Returns\n        -------\n        out: ndarray\n            The byteswapped array. If `inplace` is ``True``, this is\n            a view to self.\n\n        Examples\n        --------\n        >>> A = np.array([1, 256, 8755], dtype=np.int16)\n        >>> map(hex, A)\n        ['0x1', '0x100', '0x2233']\n        >>> A.byteswap(True)\n        array([  256,     1, 13090], dtype=int16)\n        >>> map(hex, A)\n        ['0x100', '0x1', '0x3322']\n\n        Arrays of strings are not swapped\n\n        >>> A = np.array(['ceg', 'fac'])\n        >>> A.byteswap()\n        array(['ceg', 'fac'],\n              dtype='|S3')\n            \n        ";
static char __pyx_k_804[] = "ndarray.copy (line 872)";
static char __pyx_k_805[] = "Return a copy of the array.\n\n        Parameters\n        ----------\n        order : {'C', 'F', 'A'}, optional\n            By default, the result is stored in C-contiguous (row-major) order in\n            memory.  If `order` is `F`, the result has 'Fortran' (column-major)\n            order.  If order is 'A' ('Any'), then the result has the same order\n            as the input.\n\n        Examples\n        --------\n        >>> x = np.array([[1,2,3],[4,5,6]], order='F')\n\n        >>> y = x.copy()\n\n        >>> x.fill(0)\n\n        >>> x\n        array([[0, 0, 0],\n               [0, 0, 0]])\n\n        >>> y\n        array([[1, 2, 3],\n               [4, 5, 6]])\n\n        >>> y.flags['C_CONTIGUOUS']\n        True\n\n        ";
static char __pyx_k_806[] = "ndarray.dot (line 978)";
static char __pyx_k_807[] = "a.dot(b, out=None)\n\n        Dot product of two arrays.\n\n        Refer to `numpy.dot` for full documentation.\n\n        See Also\n        --------\n        numpy.dot : equivalent function\n\n        Examples\n        --------\n        >>> a = np.eye(2)\n        >>> b = np.ones((2, 2)) * 2\n        >>> a.dot(b)\n        array([[ 2.,  2.],\n               [ 2.,  2.]])\n\n        This array method can be conveniently chained:\n\n        >>> a.dot(b).dot(b)\n        array([[ 8.,  8.],\n               [ 8.,  8.]])\n\n        ";
static char __pyx_k_808[] = "ndarray.fill (line 1031)";
static char __pyx_k_809[] = "Fill the array with a scalar value.\n\n        Parameters\n        ----------\n        value : scalar\n            All elements of `a` will be assigned this value.\n\n        Examples\n        --------\n        >>> a = np.array([1, 2])\n        >>> a.fill(0)\n        >>> a\n        array([0, 0])\n        >>> a = np.empty(2)\n        >>> a.fill(1)\n        >>> a\n        array([ 1.,  1.])\n\n        ";
static char __pyx_k_810[] = "ndarray.flatten (line 1056)";
static char __pyx_k_811[] = "Return a copy of the array collapsed into one dimension.\n\n        Parameters\n        ----------\n        order : {'C', 'F'}, optional\n            Whether to flatten in C (row-major) or Fortran (column-major) order.\n            The default is 'C'.\n\n        Returns\n        -------\n        y : ndarray\n            A copy of the input array, flattened to one dimension.\n\n        See Also\n        --------\n        ravel : Return a flattened array.\n        flat : A 1-D flat iterator over the array.\n\n        Examples\n        --------\n        >>> a = np.array([[1,2], [3,4]])\n        >>> a.flatten()\n        array([1, 2, 3, 4])\n        >>> a.flatten('F')\n        array([1, 3, 2, 4])\n\n        ";
static char __pyx_k_812[] = "ndarray.getfield (line 1086)";
static char __pyx_k_813[] = "Returns a field of the given array as a certain type.\n\n        A field is a view of the array data with each itemsize determined\n        by the given type and the offset into the current array, i.e. from\n        ``offset * dtype.itemsize`` to ``(offset+1) * dtype.itemsize``.\n\n        Parameters\n        ----------\n        dtype : str\n            String denoting the data type of the field.\n        offset : int\n            Number of `dtype.itemsize`'s to skip before beginning the element view.\n\n        Examples\n        --------\n        >>> x = np.diag([1.+1.j]*2)\n        >>> x\n        array([[ 1.+1.j,  0.+0.j],\n               [ 0.+0.j,  1.+1.j]])\n        >>> x.dtype\n        dtype('complex128')\n\n        >>> x.getfield('complex64', 0) # Note how this != x\n        array([[ 0.+1.875j,  0.+0.j   ],\n               [ 0.+0.j   ,  0.+1.875j]], dtype=complex64)\n\n        >>> x.getfield('complex64',1) # Note how different this is than x\n        array([[ 0. +5.87173204e-39j,  0. +0.00000000e+00j],\n               [ 0. +0.00000000e+00j,  0. +5.87173204e-39j]], dtype=complex64)\n\n        >>> x.getfield('complex128', 0) # == x\n        array([[ 1.+1.j,  0.+0.j],\n               [ 0.+0.j,  1.+1.j]])\n\n        If the argument dtype is the same as x.dtype, then offset != 0 raises\n        a ValueError:\n\n        >>> x.getfield('complex128', 1)\n        Traceback (most recent call last):\n          File \"<stdin>\", line 1, in <module>\n        ValueError: Need 0 <= offset <= 0 for requested type but received offset = 1\n\n        >>> x.getfield('float64', 0)\n        array([[ 1.,  0.],\n               [ 0.,  1.]])\n\n        >>> x.getfield('float64', 1)\n        array([[  1.77658241e-307,   0.00000000e+000],\n               [  0.00000000e+000,   1.77658241e-307]])\n\n        ";
static char __pyx_k_814[] = "ndarray.item (line 1140)";
static char __pyx_k_815[] = "Copy an element of an array to a standard Python scalar and return it.\n\n        Parameters\n        ----------\n        \\*args : Arguments (variable number and type)\n\n            * none: in this case, the method only works for arrays\n              with one element (`a.size == 1`), which element is\n              copied into a standard Python scalar object and returned.\n\n            * int_type: this argument is interpreted as a flat index into\n              the array, specifying which element to copy and return.\n\n            * tuple of int_types: functions as does a single int_type argument,\n              except that the argument is interpreted as an nd-index into the\n              array.\n\n        Returns\n        -------\n        z : Standard Python scalar object\n            A copy of the specified element of the array as a suitable\n            Python scalar\n\n        Notes\n        -----\n        When the data type of `a` is longdouble or clongdouble, item() returns\n        a scalar array object because there is no available Python scalar that\n        would not lose information. Void arrays return a buffer object for item(),\n        unless fields are defined, in which case a tuple is returned.\n\n        `item` is very similar to a[args], except, instead of an array scalar,\n        a standard Python scalar is returned. This can be useful for speeding up\n        access to elements of the array and doing arithmetic on elements of the\n        array using Python's optimized math.\n\n        Examples\n        --------\n        >>> x = np.random.randint(9, size=(3, 3))\n        >>> x\n        array([[3, 1, 7],\n               [2, 8, 3],\n               [8, 5, 3]])\n        >>> x.item(3)\n        2\n        >>> x.item(7)\n        5\n        >>> x.item((0, 1))\n        1\n        >>> x.item((2, 2))\n        3\n\n        ";
static char __pyx_k_816[] = "ndarray.itemset (line 1195)";
static char __pyx_k_817[] = "Insert scalar into an array (scalar is cast to array's dtype, if possible)\n\n        There must be at least 1 argument, and define the last argument\n        as *item*.  Then, ``a.itemset(*args)`` is equivalent to but faster\n        than ``a[args] = item``.  The item should be a scalar value and `args`\n        must select a single item in the array `a`.\n\n        Parameters\n        ----------\n        \\*args : Arguments\n            If one argument: a scalar, only used in case `a` is of size 1.\n            If two arguments: the last argument is the value to be set\n            and must be a scalar, the first argument specifies a single array\n            element location. It is either an int or a tuple.\n\n        Notes\n        -----\n        Compared to indexing syntax, `itemset` provides some speed increase\n        for placing a scalar into a particular location in an `ndarray`,\n        if you must do this.  However, generally this is discouraged:\n        among other problems, it complicates the appearance of the code.\n        Also, when using `itemset` (and `item`) inside a loop, be sure\n        to assign the methods to a local variable to avoid the attribute\n        look-up at each loop iteration.\n\n        Examples\n        --------\n        >>> x = np.random.randint(9, size=(3, 3))\n        >>> x\n        array([[3, 1, 7],\n               [2, 8, 3],\n               [8, 5, 3]])\n        >>> x.itemset(4, 0)\n        >>> x.itemset((2, 2), 9)\n        >>> x\n        array([[3, 1, 7],\n               [2, 0, 3],\n               [8, 5, 9]])\n\n        ";
static char __pyx_k_818[] = "ndarray.resize (line 1470)";
static char __pyx_k_819[] = "Change shape and size of array in-place.\n\n        Parameters\n        ----------\n        new_shape : tuple of ints, or `n` ints\n            Shape of resized array.\n        refcheck : bool, optional\n            If False, reference count will not be checked. Default is True.\n\n        Returns\n        -------\n        None\n\n        Raises\n        ------\n        ValueError\n            If `a` does not own its own data or references or views to it exist,\n            and the data memory must be changed.\n\n        SystemError\n            If the `order` keyword argument is specified. This behaviour is a\n            bug in NumPy.\n\n        See Also\n        --------\n        resize : Return a new array with the specified shape.\n\n        Notes\n        -----\n        This reallocates space for the data area if necessary.\n\n        Only contiguous arrays (data elements consecutive in memory) can be\n        resized.\n\n        The purpose of the reference count check is to make sure you\n        do not use this array as a buffer for another Python object and then\n        reallocate the memory. However, reference counts can increase in\n        other ways so if you are sure that you have not shared the memory\n        for this array with another Python object, then you may safely set\n        `refcheck` to False.\n\n        Examples\n        --------\n        Shrinking an array: array is flattened (in the order that the data are\n        stored in memory), resized, and reshaped:\n\n        >>> a = np.array([[0, 1], [2, 3]], order='C')\n        >>> a.resize((2, 1))\n        >>> a\n        array([[0],\n               [1]])\n\n        >>> a = np.array([[0, 1], [2, 3]], order='F')\n        >>> a.resize((2, 1))\n        >>> a\n        array([[0],\n               [2]])\n\n        Enlarging an array: as above, but missing entries are filled with zeros:\n\n        >>> b = np.array([[0, 1], [2, 3]])\n        >>> b.resize(2, 3) # new_shape parameter doesn't have to b""e a tuple\n        >>> b\n        array([[0, 1, 2],\n               [3, 0, 0]])\n\n        Referencing an array prevents resizing...\n\n        >>> c = a\n        >>> a.resize((1, 1))\n        Traceback (most recent call last):\n        ...\n        ValueError: cannot resize an array that has been referenced ...\n\n        Unless `refcheck` is False:\n\n        >>> a.resize((1, 1), refcheck=False)\n        >>> a\n        array([[0]])\n        >>> c\n        array([[0]])\n\n        ";
static char __pyx_k_820[] = "ndarray.setfield (line 1580)";
static char __pyx_k_821[] = "Put a value into a specified place in a field defined by a data-type.\n\n        Place `val` into `a`'s field defined by `dtype` and beginning `offset`\n        bytes into the field.\n\n        Parameters\n        ----------\n        val : object\n            Value to be placed in field.\n        dtype : dtype object\n            Data-type of the field in which to place `val`.\n        offset : int, optional\n            The number of bytes into the field at which to place `val`.\n\n        Returns\n        -------\n        None\n\n        See Also\n        --------\n        getfield\n\n        Examples\n        --------\n        >>> x = np.eye(3)\n        >>> x.getfield(np.float64)\n        array([[ 1.,  0.,  0.],\n               [ 0.,  1.,  0.],\n               [ 0.,  0.,  1.]])\n        >>> x.setfield(3, np.int32)\n        >>> x.getfield(np.int32)\n        array([[3, 3, 3],\n               [3, 3, 3],\n               [3, 3, 3]])\n        >>> x\n        array([[  1.00000000e+000,   1.48219694e-323,   1.48219694e-323],\n               [  1.48219694e-323,   1.00000000e+000,   1.48219694e-323],\n               [  1.48219694e-323,   1.48219694e-323,   1.00000000e+000]])\n        >>> x.setfield(np.eye(3), np.int32)\n        >>> x\n        array([[ 1.,  0.,  0.],\n               [ 0.,  1.,  0.],\n               [ 0.,  0.,  1.]])\n\n        ";
static char __pyx_k_822[] = "ndarray.setflags (line 1628)";
static char __pyx_k_823[] = "Set array flags WRITEABLE, ALIGNED, and UPDATEIFCOPY, respectively.\n\n        These Boolean-valued flags affect how numpy interprets the memory\n        area used by `a` (see Notes below). The ALIGNED flag can only\n        be set to True if the data is actually aligned according to the type.\n        The UPDATEIFCOPY flag can never be set to True. The flag WRITEABLE\n        can only be set to True if the array owns its own memory, or the\n        ultimate owner of the memory exposes a writeable buffer interface,\n        or is a string. (The exception for string is made so that unpickling\n        can be done without copying memory.)\n\n        Parameters\n        ----------\n        write : bool, optional\n            Describes whether or not `a` can be written to.\n        align : bool, optional\n            Describes whether or not `a` is aligned properly for its type.\n        uic : bool, optional\n            Describes whether or not `a` is a copy of another \"base\" array.\n\n        Notes\n        -----\n        Array flags provide information about how the memory area used\n        for the array is to be interpreted. There are 6 Boolean flags\n        in use, only three of which can be changed by the user:\n        UPDATEIFCOPY, WRITEABLE, and ALIGNED.\n\n        WRITEABLE (W) the data area can be written to;\n\n        ALIGNED (A) the data and strides are aligned appropriately for the hardware\n        (as determined by the compiler);\n\n        UPDATEIFCOPY (U) this array is a copy of some other array (referenced\n        by .base). When this array is deallocated, the base array will be\n        updated with the contents of this array.\n\n        All flags can be accessed using their first (upper case) letter as well\n        as the full name.\n\n        Examples\n        --------\n        >>> y\n        array([[3, 1, 7],\n               [2, 0, 0],\n               [8, 5, 9]])\n        >>> y.flags\n          C_CONTIGUOUS : True\n          F_CONTIGUOUS : ""False\n          OWNDATA : True\n          WRITEABLE : True\n          ALIGNED : True\n          UPDATEIFCOPY : False\n        >>> y.setflags(write=0, align=0)\n        >>> y.flags\n          C_CONTIGUOUS : True\n          F_CONTIGUOUS : False\n          OWNDATA : True\n          WRITEABLE : False\n          ALIGNED : False\n          UPDATEIFCOPY : False\n        >>> y.setflags(uic=1)\n        Traceback (most recent call last):\n          File \"<stdin>\", line 1, in <module>\n        ValueError: cannot set UPDATEIFCOPY flag to True\n\n        ";
static char __pyx_k_824[] = "ndarray.sort (line 1697)";
static char __pyx_k_825[] = "Sort an array, in-place.\n\n        Parameters\n        ----------\n        axis : int, optional\n            Axis along which to sort. Default is -1, which means sort along the\n            last axis.\n        kind : {'quicksort', 'mergesort', 'heapsort'}, optional\n            Sorting algorithm. Default is 'quicksort'.\n        order : list, optional\n            When `a` is an array with fields defined, this argument specifies\n            which fields to compare first, second, etc.  Not all fields need be\n            specified.\n\n        See Also\n        --------\n        numpy.sort : Return a sorted copy of an array.\n        argsort : Indirect sort.\n        lexsort : Indirect stable sort on multiple keys.\n        searchsorted : Find elements in sorted array.\n\n        Notes\n        -----\n        See ``sort`` for notes on the different sorting algorithms.\n\n        Examples\n        --------\n        >>> a = np.array([[1,4], [3,1]])\n        >>> a.sort(axis=1)\n        >>> a\n        array([[1, 4],\n               [1, 3]])\n        >>> a.sort(axis=0)\n        >>> a\n        array([[1, 3],\n               [1, 4]])\n\n        Use the `order` keyword to specify a field to use when sorting a\n        structured array:\n\n        >>> a = np.array([('a', 2), ('c', 1)], dtype=[('x', 'S1'), ('y', int)])\n        >>> a.sort(order='y')\n        >>> a\n        array([('c', 1), ('a', 2)],\n              dtype=[('x', '|S1'), ('y', '<i4')])\n\n        ";
static char __pyx_k_826[] = "ndarray.tolist (line 1848)";
static char __pyx_k_827[] = "Return the array as a (possibly nested) list.\n\n        Return a copy of the array data as a (nested) Python list.\n        Data items are converted to the nearest compatible Python type.\n\n        Parameters\n        ----------\n        none\n\n        Returns\n        -------\n        y : list\n            The possibly nested list of array elements.\n\n        Notes\n        -----\n        The array may be recreated, ``a = np.array(a.tolist())``.\n\n        Examples\n        --------\n        >>> a = np.array([1, 2])\n        >>> a.tolist()\n        [1, 2]\n        >>> a = np.array([[1, 2], [3, 4]])\n        >>> list(a)\n        [array([1, 2]), array([3, 4])]\n        >>> a.tolist()\n        [[1, 2], [3, 4]]\n\n        ";
static char __pyx_k_828[] = "ndarray.tostring (line 1881)";
static char __pyx_k_829[] = "Construct a Python string containing the raw data bytes in the array.\n\n        Constructs a Python string showing a copy of the raw contents of\n        data memory. The string can be produced in either 'C' or 'Fortran',\n        or 'Any' order (the default is 'C'-order). 'Any' order means C-order\n        unless the F_CONTIGUOUS flag in the array is set, in which case it\n        means 'Fortran' order.\n\n        Parameters\n        ----------\n        order : {'C', 'F', None}, optional\n            Order of the data for multidimensional arrays:\n            C, Fortran, or the same as for the original array.\n\n        Returns\n        -------\n        s : str\n            A Python string exhibiting a copy of `a`'s raw data.\n\n        Examples\n        --------\n        >>> x = np.array([[0, 1], [2, 3]])\n        >>> x.tostring()\n        '\000\000\000\000\001\000\000\000\002\000\000\000\003\000\000\000'\n        >>> x.tostring('C') == x.tostring()\n        True\n        >>> x.tostring('F')\n        '\000\000\000\000\002\000\000\000\001\000\000\000\003\000\000\000'\n\n        ";
static char __pyx_k_830[] = "ndarray.transpose (line 1926)";
static char __pyx_k_831[] = "Returns a view of the array with axes transposed.\n\n        For a 1-D array, this has no effect. (To change between column and\n        row vectors, first cast the 1-D array into a matrix object.)\n        For a 2-D array, this is the usual matrix transpose.\n        For an n-D array, if axes are given, their order indicates how the\n        axes are permuted (see Examples). If axes are not provided and\n        ``a.shape = (i[0], i[1], ... i[n-2], i[n-1])``, then\n        ``a.transpose().shape = (i[n-1], i[n-2], ... i[1], i[0])``.\n\n        Parameters\n        ----------\n        axes : None, tuple of ints, or `n` ints\n\n         * None or no argument: reverses the order of the axes.\n\n         * tuple of ints: `i` in the `j`-th place in the tuple means `a`'s\n           `i`-th axis becomes `a.transpose()`'s `j`-th axis.\n\n         * `n` ints: same as an n-tuple of the same ints (this form is\n           intended simply as a \"convenience\" alternative to the tuple form)\n\n        Returns\n        -------\n        out : ndarray\n            View of `a`, with axes suitably permuted.\n\n        See Also\n        --------\n        ndarray.T : Array property returning the array transposed.\n\n        Examples\n        --------\n        >>> a = np.array([[1, 2], [3, 4]])\n        >>> a\n        array([[1, 2],\n               [3, 4]])\n        >>> a.transpose()\n        array([[1, 3],\n               [2, 4]])\n        >>> a.transpose((1, 0))\n        array([[1, 3],\n               [2, 4]])\n        >>> a.transpose(1, 0)\n        array([[1, 3],\n               [2, 4]])\n\n        ";
static char __pyx_k_832[] = "ndarray.view (line 2009)";
static char __pyx_k_833[] = "New view of array with the same data.\n\n        Parameters\n        ----------\n        dtype : data-type, optional\n            Data-type descriptor of the returned view, e.g., float32 or int16.\n            The default, None, results in the view having the same data-type\n            as `a`.\n        type : Python type, optional\n            Type of the returned view, e.g., ndarray or matrix.  Again, the\n            default None results in type preservation.\n\n        Notes\n        -----\n        ``a.view()`` is used two different ways:\n\n        ``a.view(some_dtype)`` or ``a.view(dtype=some_dtype)`` constructs a view\n        of the array's memory with a different data-type.  This can cause a\n        reinterpretation of the bytes of memory.\n\n        ``a.view(ndarray_subclass)`` or ``a.view(type=ndarray_subclass)`` just\n        returns an instance of `ndarray_subclass` that looks at the same array\n        (same shape, dtype, etc.)  This does not cause a reinterpretation of the\n        memory.\n\n\n        Examples\n        --------\n        >>> x = np.array([(1, 2)], dtype=[('a', np.int8), ('b', np.int8)])\n\n        Viewing array data using a different type and dtype:\n\n        >>> y = x.view(dtype=np.int16, type=np.matrix)\n        >>> y\n        matrix([[513]], dtype=int16)\n        >>> print type(y)\n        <class 'numpy.matrixlib.defmatrix.matrix'>\n\n        Creating a view on a structured array so it can be used in calculations\n\n        >>> x = np.array([(1, 2),(3,4)], dtype=[('a', np.int8), ('b', np.int8)])\n        >>> xv = x.view(dtype=np.int8).reshape(-1,2)\n        >>> xv\n        array([[1, 2],\n               [3, 4]], dtype=int8)\n        >>> xv.mean(0)\n        array([ 2.,  3.])\n\n        Making changes to the view changes the underlying array\n\n        >>> xv[0,1] = 20\n        >>> print x\n        [(1, 20) (3, 4)]\n\n        Using a view to convert an array to a record array:\n\n        >>> z = x.view(np.recarray)\n        >>> z.a""\n        array([1], dtype=int8)\n\n        Views share data:\n\n        >>> x[0] = (9, 10)\n        >>> z[0]\n        (9, 10)\n\n        ";
static char __pyx_k_834[] = "ufunc.reduce (line 2707)";
static char __pyx_k_835[] = "reduce(a, axis=0, dtype=None, out=None)\n\n    Reduces `a`'s dimension by one, by applying ufunc along one axis.\n\n    Let :math:`a.shape = (N_0, ..., N_i, ..., N_{M-1})`.  Then\n    :math:`ufunc.reduce(a, axis=i)[k_0, ..,k_{i-1}, k_{i+1}, .., k_{M-1}]` =\n    the result of iterating `j` over :math:`range(N_i)`, cumulatively applying\n    ufunc to each :math:`a[k_0, ..,k_{i-1}, j, k_{i+1}, .., k_{M-1}]`.\n    For a one-dimensional array, reduce produces results equivalent to:\n    ::\n\n     r = op.identity # op = ufunc\n     for i in xrange(len(A)):\n       r = op(r, A[i])\n     return r\n\n    For example, add.reduce() is equivalent to sum().\n\n    Parameters\n    ----------\n    a : array_like\n        The array to act on.\n    axis : int, optional\n        The axis along which to apply the reduction.\n    dtype : data-type code, optional\n        The type used to represent the intermediate results. Defaults\n        to the data-type of the output array if this is provided, or\n        the data-type of the input array if no output array is provided.\n    out : ndarray, optional\n        A location into which the result is stored. If not provided, a\n        freshly-allocated array is returned.\n\n    Returns\n    -------\n    r : ndarray\n        The reduced array. If `out` was supplied, `r` is a reference to it.\n\n    Examples\n    --------\n    >>> np.multiply.reduce([2,3,5])\n    30\n\n    A multi-dimensional array example:\n\n    >>> X = np.arange(8).reshape((2,2,2))\n    >>> X\n    array([[[0, 1],\n            [2, 3]],\n           [[4, 5],\n            [6, 7]]])\n    >>> np.add.reduce(X, 0)\n    array([[ 4,  6],\n           [ 8, 10]])\n    >>> np.add.reduce(X) # confirm: default axis value is 0\n    array([[ 4,  6],\n           [ 8, 10]])\n    >>> np.add.reduce(X, 1)\n    array([[ 2,  4],\n           [10, 12]])\n    >>> np.add.reduce(X, 2)\n    array([[ 1,  5],\n           [ 9, 13]])\n\n        ";
